      duration: "30분 전",
    },
    {
      title: "오늘 저녁밥 메뉴에 대한 고민상담",
      author: "참여자 : 고죠 사토루, 이순신",
      duration: "30분 전",
    },
    {
      title: "오늘 저녁밥 메뉴에 대한 고민상담",
      author: "참여자 : 고죠 사토루, 이순신",
      duration: "30분 전",
    },
  ];

  return (
    <div className="container mx-auto py-4">
      {/* 왼쪽 섹션 */}
      <div className="w-1/4 bg-gray-100 p-4 ">Left</div>

      <div className="min-h-screen bg-green-50 p-8">
        {/* Header */}
        <div className="mb-8">
          <h1 className="text-2xl font-bold mb-4">대시보드</h1>
          <h2 className="text-lg mb-4">내 채팅 기록</h2>
        </div>

        {/* Video Grid */}
        <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-6">
          {Cards.map((video, index) => (
            <VideoCard
              key={index}
              title={video.title}
              author={video.author}
              duration={video.duration}
            />
          ))}
        </div>

        {/* Add New Button */}
        <button className="fixed bottom-8 right-8 bg-green-700 text-white rounded-full p-4 shadow-lg hover:bg-green-800 transition-colors">
          <Plus className="w-6 h-6" />
          <span className="ml-2">새 채팅 시작하기</span>
        </button>
      </div>
      <div className="w-2/4 bg-gray-100 p-4 ">Right</div>
    </div>
  );
};

export default Dashboard;
